import RichaPath from "../assets/RichaPath";

const RichaSVG = () => {
  return (
    <div className="w-80 animate-[fade_4s_ease-in-out]">
      <svg width="100%" viewBox="0 0 770 434">
        <RichaPath />
      </svg>
    </div>
  );
};

export default RichaSVG;
